const Education = () => {
  return (
    <div style={{ minHeight: '80vh', backgroundColor: '#222', color: '#fff', padding: '2rem' }}>
      <h1 style={{ color: '#ff6600', fontSize: '2.5rem', marginBottom: '1rem' }}>Education</h1>
      <div style={{ color: '#ccc', fontSize: '1.2rem', lineHeight: '1.8' }}>
        <h3 style={{ color: '#fff' }}>Government Engineering College, Bharuch</h3>
        <p>Affiliated with Gujarat Technological University</p>
        <p>Bachelor of Engineering in Computer Engineering</p>
        <p>Expected Graduation: June 2026</p>
        <p><strong>Relevant Coursework:</strong> Data Structures and Algorithms, Data Science, Machine Learning, Artificial Intelligence, Probability and Statistics, Linear Algebra</p>
      </div>
    </div>
  );
};

export default Education;
